import React, { useEffect, useState } from "react";

const Home = () => {

  const [levels, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000");
      const jsonData = await response.json();
      setDict(jsonData);
      //console.log(levels);
    } catch (err) {
      console.error(err.message);
    }
  };

  useEffect(() => {
    getDict();
  }, []);

  const prom_level = [];
  for (const key in levels.PANDEV) {
    prom_level.push(levels.PANDEV);
  }

  console.log(levels.PANDEV);

  return (
    <table class="table mt-5 text-center">
      <thead>
        <tr>
          <th>Description</th>
          <th>Edit</th>
          <th>Delete</th>
        </tr>
      </thead>
      <tbody>
        {levels.PANDEV.map(todo => (
          <tr key={todo.todo_id}>
            <td>{todo.description}</td>
            <td>
              <EditTodo todo={todo} />
            </td>
            <td>
              <button className="btn btn-danger" onClick={() => deleteTodo(todo.todo_id)}>
                Delete
              </button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Home;
